import styled from "styled-components";

function SetProducts() {
  const StyledDiv = styled.div`
    width: 90%;
    height: 80px;
    left: 0;
    right: 0;
    margin: auto;
    margin-top: 20px;
    border: 1px solid black;
  `;
  const StyledList = styled.ul`
    display: flex;
    width: 100%;
    height: 100%;
    justify-content: space-between;
    align-items: center;
    list-style-type: none;
  `;
    const StyledListItems = styled.li`
    curso
  `;
  return (
    <StyledDiv>
      <StyledList>
        <StyledListItems>awd</StyledListItems>
        <StyledListItems>fesg</StyledListItems>
        <StyledListItems>jtuj</StyledListItems>
        <StyledListItems>d32t</StyledListItems>
      </StyledList>
    </StyledDiv>
  );
}

export default SetProducts;
